import React from "react";
import ReactDOM from "react-dom";
import GeneralSorting from "./sorting/GeneralSorting"
import "./index.css";
import * as serviceWorker from './serviceWorker';

ReactDOM.render(<GeneralSorting myref="e1" name="Welcome to Sorting application!"/>, document.getElementById("root"));
ReactDOM.render(<GeneralSorting myref="e2" name="Welcome to Sorting 000 application!"/>, document.getElementById("kot"));
serviceWorker.unregister();
